function addOnloadEvent(fnc)
{
	if ( typeof window.addEventListener != "undefined" )
		window.addEventListener( "load", fnc, false );
	else if ( typeof window.attachEvent != "undefined" )
		window.attachEvent( "onload", fnc );
	else 
	{
		if ( window.onload != null )
		{
			var oldOnload = window.onload;
			window.onload = function ( e ) {
				oldOnload( e );
				window[fnc]()
			};
		}
		else 
			window.onload = fnc;
	}
}

function func5C4557AB()
{
	var canvas = document.getElementById("C5C4557AB");
	if (canvas.getContext) 
	{
		var context = canvas.getContext("2d");
		var A5C4557AB = new Image();
		A5C4557AB.onload = function(){
		  context.drawImage(A5C4557AB, 0, 0, 74.0000, 75.0000);
		  }
	}
	A5C4557AB.src = "5C4557AB.png";
}
addOnloadEvent(func5C4557AB);

